import React from "react";
import { Box } from "@mui/material";
import { IProduct } from "../context/product";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
type ProductProps = {
  products: IProduct[];
};

function createData(
  id: string,
  brand: string,
  category: string,
  description: string,
  discountPercentage: number,
  price: number,
  rating: number,
  stock: number,
  images: string[],
  thumbnail: string,
  title: string
) {
  return {
    id,
    brand,
    category,
    description,
    discountPercentage,
    price,
    rating,
    stock,
    images,
    thumbnail,
    title,
  };
}

const Product: React.FC<ProductProps> = ({ products }) => {
  console.log("products", products);

  return (
    <Box mt={5} style={{ display: "flex", justifyContent: "space-between" }}>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>Id</TableCell>
              <TableCell align="right">Brand</TableCell>
              <TableCell align="right">Fat&nbsp;(g)</TableCell>
              <TableCell align="right">Carbs&nbsp;(g)</TableCell>
              <TableCell align="right">Protein&nbsp;(g)</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {products.map((row) => (
              <TableRow
                key={row.id}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell component="th" scope="row">
                  {row.id}
                </TableCell>
                <TableCell align="right">{row.brand}</TableCell>
                <TableCell align="right">{row.category}</TableCell>
                <TableCell align="right">{row.description}</TableCell>
                <TableCell align="right">{row.discountPercentage}</TableCell>
                <TableCell align="right">{row.price}</TableCell>
                <TableCell align="right">{row.rating}</TableCell>
                <TableCell align="right">{row.stock}</TableCell>
                <TableCell align="right">{row.images}</TableCell>
                <TableCell align="right">{row.thumbnail}</TableCell>
                <TableCell align="right">{row.title}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default Product;
